import Introduction from './components/Introduction';
import ServicePage from './pages/ServicePage';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import ServiceCard from '../components/ServiceCard';
import HighlightedProduct from '../components/HighlightedProduct';
import ClientTestimonial from '../components/ClientTestimonial';

import Login from './src/components/Login';
import Register from './src/components/Register';

function App() {
 

  return (
    <div className="App">
      <nav className="bg-blue-500 p-4 flex items-center">
        {/* Logo Section */}
        <div className="flex-shrink-0">
          <img src="src/assets/images/logo.png" alt="Logo" className="h-8 w-8 mr-4" />
        </div>

        {/* Navigation Links */}
        <ul className="flex justify-around w-full">
          <li><a href="#Introduction" className="text-white">Introduction</a></li>
          <li><a href="#ServiceCard" className="text-white">Services</a></li>
          <li><a href="#HighlitedProduct" className="text-white">Products</a></li>
          <li><a href="#ClientTestimonial" className="text-white">Testimonials</a></li>
          <li><a href="#Register" className="text-white">Register</a></li>
          <li><a href="#Login" className="text-white">Login</a></li>
        </ul>
      </nav>
      <Router>
      <div className="App">
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
        </Routes>
      </div>
    </Router>

      <section id="introduction" className="p-4">
        <Introduction />
      </section>

      <section id="services" className="p-4">
        
        <ServicePage  />
      </section>
    </div>
  );
}

export default App;
